import "./sign-in.scss";
import { useEffect } from "react";
import { getRedirectResult } from "firebase/auth";
// import { signInWithGooglePopup, signInWithGoogleRedirect, createUserDocRefFromAuth } from "../../utils/firebase/firebase.utils";
import { auth, logGoogleUsersWithPopUp, signInWithGoogleRedirect } from "../../utils/firebase/firebase.utils";

function SignIn() {
	useEffect(async () => {
		const response = await getRedirectResult(auth);
		console.log(response);
	}, []);

	return (
		<div className="sign-in">
			<h1>Sign-In</h1>
			<button onClick={logGoogleUsersWithPopUp}>Google Sign In</button>
			<button onClick={signInWithGoogleRedirect}>Google Sign In w/ Redirect</button>
		</div>
	);
}

export default SignIn;
